import classes from "./NewPost.module.css"

function NewPost() {
    let enteredBook = "";
    function changeBookHandler(event) {
        console.log(event.target.value)
        enteredBook = event.target.value;
    }
    return (<form className={classes}>
        <label className={
                classes.author
            }
            htmlFor="author">Author</label><br/>
        <input id="author" type="text"></input><br/>
        <label className={
                classes.book
            }
            htmlFor="book">Book</label><br/>
        <textarea id="book" required
            rows={3}
            onChange={changeBookHandler}></textarea>
        <p> {enteredBook}</p>
    </form>)
}
export default NewPost;
